import React from "react";
import searchIcon from "./images/search.svg";
const Header = ({ SearchToggle, searchShow, searchvalue, showSpinner }) => {
  return (
    //className={`${showSpinner ? "blur" : null}`}
    <div className={"overHead"`${showSpinner ? "blur" : null}`}>
      <div className="Header">
        <h1>Header</h1>
        <div className="searchInputButton">
          {searchShow && (
            <input
              id="search"
              autoFocus
              className="search btn"
              onChange={searchvalue}
            ></input>
          )}
          <button className="boxedButton btn" onClick={SearchToggle}>
            <img src={searchIcon} alt="search" />
          </button>
        </div>
      </div>
    </div>
  );
};

export default Header;
